import { FC, useEffect, useState } from 'react';
import axios from 'axios';
import ParkingSpotCard from '../components/ParkingSpotCard.tsx';
import AddSpotForm from '../components/AddSpotForm';
import React from 'react';

const Home: FC = () => {
  const [spots, setSpots] = useState([]);

  const fetchSpots = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/spots');
      setSpots(response.data);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    fetchSpots();
  }, []);

  return (
    <div>
      <h1 className="text-center text-3xl font-bold my-6">Parking Spots</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        {spots.map((spot:any) => (
          <ParkingSpotCard key={spot._id} spot={spot} />
        ))}
      </div>
      <AddSpotForm />
    </div>
  );
};

export default Home;
